      mountain: '‚õ∞Ô∏è',
      nature: 'üåø',
      sea: 'üåä',
      museum: 'üèõÔ∏è'
    };
    return icons[type] || 'üìç';
  };

  return (
    <div className="attraction-card">
      <div className="attraction-header">
        <span className="attraction-icon">{getTypeIcon(attraction.type)}</span>
        <h3>{attraction.name}</h3>
        <div className="rating">
          ‚≠ê {attraction.rating}
